// import { Link } from "react-router-dom";
import { Navbar, NavbarBrand, NavbarItem} from "react-bulma-components"
import "./style.css";


function NavBar() {
    return (

        <Navbar>
              <NavbarBrand>
                    <NavbarItem href="#">
                        <h3>MEsuem</h3>
                    </NavbarItem>
                </NavbarBrand>
        </Navbar>
    );
}

export default NavBar;
